!-------------------------------------------------------------------------------
!  Evaluate the Laplacian of the shape functions for the corresponding polynomial degree
!  
!  Input:
!            elem     element to integrate
!            l        lambda, i.e., natural (barycentric) coordinates of the point 
!            xl,yl    coordinates of the triangle vertices
!            polylo   lowest polynomial degree to consider
!            polyhi   highest polynomial degree 
!            nff      number of formfunctons
!  Output:
!            vec    Laplacian of the shape function at xi, yi 
!  Errorcodes:
!            errcode  2001 = polylo is greater than polyhi
!                     2002 = polynomial degree cannot be higher than polymax. 
!                            See globalvariables
!
!--------------------------------------------------------------------------
! LATEST SHAPE FUNCTIONS:
!
! Gramm-Schmidt Version 2: Orthogonalized to mass matrix;
!                          Scaled/Normalized to mass matrix.
! Compilation time on the Cluster with ifort 8.1 : 1m 27.063s
!--------------------------------------------------------------------------
!  local variables
      integer (I4B), allocatable :: inach(:), ivorg(:)
      real (DP), allocatable :: gl(:,:), delx(:), dely(:)
      integer (I4B) k, order
      real (DP) area2, L1, L2, L3
      complex(DPC) n12, n13, n23, nu11gl11, nu22gl32
!
      allocate(inach(3))
      allocate(ivorg(3))
      allocate(gl(3,2))
      allocate(delx(3))
      allocate(dely(3))
!
!  Dynamic allocation, goes to call stack 
      inach(1)=2
      inach(2)=3
      inach(3)=1
      ivorg(1)=3
      ivorg(2)=1
      ivorg(3)=2
!
!  Check values of polylo and polyhi
      if ((polylo .gt. polymax) .or. (polyhi .gt. polymax)) then
        errcode = 2002
        return
      end if
      if (polylo .gt. polyhi) then
        errcode = 2001
        return
      end if
!
!  Calculation of the div of the gradients (Laplacian)

        delx(:)= yl(inach(:))-yl(ivorg(:))
        dely(:)=-xl(inach(:))+xl(ivorg(:))
!  Twice the triangle area
        area2=delx(1)*dely(2)-delx(2)*dely(1)

!  Gradients:  gl(i,1) is the x-component of the gradient of lambda_i
        gl(:,1)=delx(:)/area2
        gl(:,2)=dely(:)/area2

! substitute l(n) to Ln
      L1=l(1)
      L2=l(2)
      L3=l(3)

!------------------------------------------------------------------------------
!  Substitute n in vec in terms of nu and grad of lambda's
!
!  n_ij = 1/2[ (nu*gl_i)*gl_j + (nu*gl_j)*gl_i ]
!
! expanding the right hand side,
!
! n_ij= nu_11*(delL_i/delx)(delL_j/delx) +  
!         nu_12*(delL_i/dely)(delL_j/delx) +  
!         nu_21*(delL_i/delx)(delL_j/dely) +
!         nu_22*(delL_i/dely)(delL_j/dely) 
!-----------------------------------------------------------------------------
