!  there are no terms n_ji in vec below


! simplify off diagonal, there are no diagonal terms for this set
   nu11gl11 = nu(1,1)*gl(1,1)
   nu22gl32 = nu(2,2)*gl(3,2)


      n12 = nu11gl11*gl(2,1) + nu(1,2)*( gl(1,2)*gl(2,1) + gl(1,1)*gl(2,2) ) + &
